var title_f19_45_20178="How doctors check breast tissue in men PI";
var content_f19_45_20178=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=PI%2F65845&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=PI%2F65845&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 563px\">",
"   <div class=\"ttl\">",
"    How doctors check breast tissue in men",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 543px; height: 539px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    To check a man's breast, the doctor or nurse will bring his or her fingers together around the nipple (as shown). If the tissue is breast tissue and not fat, the doctor or nurse should feel a rubbery or firm circle of tissue centered under the nipple. (When men develop breast tissue, it is called \"gynecomastia.\") If the tissue is fat, the doctor or nurse will not feel any firm bit of tissue. The whole breast will feel soft.",
"    <br>",
"     The doctor or nurse will also check if the firm tissue is at the center of the breast or off to the side. If there is firm tissue that is not centered, it could be cancer.",
"     <div class=\"footnotes\">",
"     </div>",
"     <div class=\"reference\">",
"     </div>",
"    </br>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
