"      Owley T, McMahon W, Cook EH, et al, &ldquo;Multisite, Double-Blind, Placebo-Controlled Trial of Porcine Secretin in Autism,&rdquo;",
"      <i>",
"       J Am Acad Child Adolesc Psychiatry",
"      </i>",
"      , 2001, 40(11):1293-9.",
"      <span class=\"pubmed-id\">",
"       [PubMed",
