"   <h1>",
"    REFERENCES",
"   </h1>",
"   <ol id=\"reference\">",
"    <li>",
"     <div class=\"reference\">",
"      DHHS Panel on Antiretroviral Guidelines for Adults and Adolescents, &ldquo;Guidelines for the Use of Antiretroviral Agents in HIV-1-Infected Adults and Adolescents, Department of Health and Human Services,&rdquo; February 12, 2013;1-267. Available at",
"      <a href=\"file://aidsinfo.nih.gov/Guidelines/GuidelineDetail.aspx?GuidelineID=7&amp;ClassID=1\" target=\"_blank\">",
"       file://www.aidsinfo.nih.gov",
"      </a>",
"     </div>",
"    </li>",
"    <li>",
"     <div class=\"reference\">",
"      DHHS Panel on Treatment of HIV-Infected Pregnant Women and Prevention of Perinatal Transmission, \"Recommendations for Use of Antiretroviral Drugs in Pregnant HIV-1-Infected Women for Maternal Health and Interventions to Reduce Perinatal HIV Transmission in the United States,\"  July 31, 2012. Available at",
