"  <div class=\"headingAnchor\" id=\"references\">",
"   <h1>",
"    REFERENCES",
"   </h1>",
"   <ol id=\"reference\">",
"    <li>",
"     <a class=\"nounderline abstract\" href=\"UTD.htm?19/45/20184/abstract/1\">",
"      Burger HG. Androgen production in women. Fertil Steril 2002; 77 Suppl 4:S3.",
"     </a>",
"    </li>",
